import React from 'react';
import './ModelDetails.css';

const ModelDetails = ({ model, onDeselect }) => {
  return (
    <div className="model-details">
      <h3>Detalles del Modelo: {model.name}</h3>
      <div className="attributes-container">
        {Object.entries(model.additionalAttribute).map(([key, value]) => (
          <div key={key} className="attribute-card">
            <strong>{key}:</strong> {value}
          </div>
        ))}
      </div>
      <button onClick={onDeselect}>Deseleccionar Modelo</button>
    </div>
  );
};

export default ModelDetails;
